import React, { useState, useEffect } from 'react';

import './styles.css'

const Index = (props) => {

  // New Skill
  const newSkill = {
    img: props.picture,
    title: props.title,
    rating: props.rating
  }

  console.log(newSkill);


  // Inital data
  const dataSkills = [
    {
      img: "data:image/jpeg;base64,",
      title: "Jenkins",
      rating: "* * ",
    },
    {
      img: "data:image/png;base64,",
      title: "NodeJS",
      rating: "* * *",
    },
    {
      img: "data:image/jpeg;base64,",
      title: "Python",
      rating: "* * * * * ",
    },
    {
      img: "data:image/png;base64,",
      title: "Ansible",
      rating: "* *",
    },
    {
      img: "data:image/jpeg;base64,",
      title: "Kubernetes",
      rating: "* * ",
    },
    {
      img: "data:image/jpeg;base64,",
      title: "Docker",
      rating: "* * * * *",
    }
  ];

  // SKills State
  const [skillData, setSkills] = useState(dataSkills);

  // 
  function setNewSkill() {
    if (!props.title && !props.rating && !props.picture) {
      return false
    }
    setSkills([...skillData, newSkill])
  }

  //
  useEffect(() => {
    const data = localStorage.getItem('skillData');
    if (data) {
      setSkills(JSON.parse(data));
    }
  }, [])

  // 
  useEffect(() => {
    setNewSkill()
    localStorage.setItem('skillData', JSON.stringify(skillData))
  }, [])

  return (
    < section id="skills" >
      <div className="skills-content">
        <div className="skills-text">
          <h1>Skills</h1>
          <p>I work in such programs as</p>
        </div>
        <div className="skills-carts">
          {
            skillData.map(skills => (
              <div className="card">
                <div className="portfolio-icons">
                  <i className={props.iconDelete}></i>
                  <i className={props.iconEdit}></i>
                </div>
                <img src={skills.img} alt={skills.title} />
                <h1>{skills.title}</h1>
                <p>{skills.rating}</p>
              </div>
            )
            )}
        </div>
      </div>
    </section >
  )
}

export default Index;
















